import logo from './logo.svg';
import './App.css';
import { Switch, Route } from 'react-router-dom'
import Home from './pages/Home'
import AddUSer from './pages/AddUSer'

function App() {
  return (
    <div className="App">
      <Switch>
        <Route exact path='/' component={Home}/>
        <Route exact path='/addUSer' component={AddUSer}/>
      </Switch>
    </div>
  );
}

export default App;
